export default function ProductSection() {
  let test = [];
  for (let i = 0; i < 10; i++) {
    test.push(i + 1);
  }
  return (
    <div className="container grid grid-cols-4 gap-4 p-8">
      {test.forEach((el) => {
        <Card />;
      })}
    </div>
  );
}
